import { Button } from 'semantic-ui-react';

class App extends Component{

    render(){
        return(
            <div style={
                {
                    display: 'flex',  
                    justifyContent:'center', 
                    alignItems:'center', 
                    height: '100vh'
                }
            }>
                <h2>Edu-Ledger</h2>
            </div>
        )
    };
}

export default App;
